        /**
         * FULL VIEW : Zoom 적용 함수.
         **/
         scwin.zoomResolve = function() {
            var width = window.innerWidth || document.body.clientWidth;
            var height = window.innerHeight || document.body.clientHeight;
            var ratio = height / width;
            var baseRatio = 0.5625;
            if(ratio > baseRatio) {
                if(window.wrap) {
                    wrap.addClass("hideWidget"); 
                    $("html").css("font-size", 15 - ratio + "px"); 
                }
                return {"baseWidth" : 1440, "baseHeight" : 1080};
            } else {
                if(window.wrap) {
                    wrap.removeClass("hideWidget");
                    $("html").css("font-size", 15 - ratio + "px"); 
                }
                return {"baseWidth" : 1920, "baseHeight" : 1080};
            }
        };

        if(WebSquare.BootLoader.browserCheck.ieAllVersion) {
            WebSquare.util.setFullView(scwin.zoomResolve);
        }

