        //메뉴 선택 이벤트 정의.
        scwin.MenuSelect = function(value, nodeElement, index) {
            
            var openNodeArr = $("#trv_MenuList .w2treeview_node[opened=true]");
            var openDepth = Number(this.findNodeByIndex(index).depth);
            
            for(var i=0; i<openNodeArr.length; i++){
                var openIndex = $(openNodeArr[i]).attr("index");
                trv_MenuList.collapseNode( Number(openIndex) );
            }
            
            var matchData = dlt_MenuList.getMatchedJSON( "menuCd" , value , true)[0];
            var depth = Number(matchData.depth);
            var childDepth = depth + 1;
            var parentMenu = matchData.parentMenu;
            
            //부모노드 display
            while(true){
                var pMatchData  = dlt_MenuList.getMatchedJSON( "menuCd" , parentMenu , true);
                
                //부모가 없으면 skip
                if(pMatchData.length == 0) break;
                
                var pDepth      = Number(pMatchData[0].depth);
                var pChildDepth = pDepth + 1;
                var pValue      = pMatchData[0].menuCd;
                parentMenu      = pMatchData[0].parentMenu;
                
                trv_MenuList.expandNode( pValue , false );
                trv_MenuList.setStyle("width", (pChildDepth*225)+"px");
            }
            
            //클릭한 노드 display
            trv_MenuList.expandNode( value);
            trv_MenuList.setStyle("width", (childDepth*225)+"px");
        };

        //메뉴 선택시 선택된 메뉴의 네비게이션을 배열로 가져옵니다.
        scwin.ShowMenuNavi = function(){
            var pJsonObj        = arguments[0];
            var isMenuCd        = false;
            if(arguments.length > 1){
                isMenuCd = arguments[0];
            }
            
            var menuCd          = pJsonObj.menuCd;
            var menuNm          = pJsonObj.menuNm;
            var depth           = pJsonObj.depth;
            var parentMenu      = pJsonObj.parentMenu;
                
            $w.log(menuCd+","+menuNm+","+depth+","+parentMenu);
                
            var naviArr =  new Array();
            if(isMenuCd){
                naviArr.push(menuCd);
            }else{
                naviArr.push(menuNm);
            }
            
            
            while(Number(parentMenu) != ""){
                var parentMatchData = dlt_MenuList.getMatchedJSON( "menuCd" , parentMenu , true);
                
                if(isMenuCd){
                    naviArr.push(parentMatchData[0].menuCd);
                }else{
                    naviArr.push(parentMatchData[0].menuNm);
                }
                
                parentMenu = parentMatchData[0].parentMenu;
            }
            
            naviArr = naviArr.reverse();
            return naviArr;
        };

